CREATE TABLE contests (
  contest_id INT,
  hacker_id INT,
  name VARCHAR(100)
);

CREATE TABLE challenges (
  challenge_id INT,
  college_id INT
);

CREATE TABLE colleges (
  college_id INT,
  contest_id INT
);

CREATE TABLE submission_stats (
  challenge_id INT,
  total_submissions INT,
  total_accepted_submissions INT
);

CREATE TABLE view_stats (
  challenge_id INT,
  total_views INT,
  total_unique_views INT
);

